	private Date convertDate(String d) {
        SimpleDateFormat formatter = new SimpleDateFormat("dd-MM-yyyy");
        try {
            Date date = formatter.parse(d);
            return date;
        } catch (ParseException e) {
            e.printStackTrace();
            return new Date();
        }
	}

